import React from 'react'

export const Card = (props) => {
const {id, productName, price,productImage} = props.data
  return (
    <>
        <div className="card">
            <img src={productImage} alt="" />
            <div className="description">
              <h3>{productName}</h3>
              <p>{price}</p>
            </div>
        </div>
    </>
  );
}
